import React from "react";
import { Link, Outlet, useNavigate } from "react-router-dom";
import "../App.css";

export default function AdminLayout() {
  const nav = useNavigate();

  return (
    <div className="admin-wrap">
      <div className="admin-sidebar">
        <h2 className="admin-title">Admin</h2>

        <Link className="admin-link" to="/admin">Home</Link>
        <Link className="admin-link" to="/admin/users">Users</Link>
        <Link className="admin-link" to="/admin/messages">Messages</Link>
        <Link className="admin-link" to="/admin/repairs">Repairs</Link>
        <Link className="admin-link" to="/admin/categories">Categories</Link>
        <Link className="admin-link" to="/admin/products">Products</Link>
        <Link className="admin-link" to="/admin/admins">Admins</Link>

        <button className="admin-back-site" onClick={() => nav("/")}>
          â¬… Back to Website
        </button>
      </div>

      <div className="admin-content">
        <Outlet />
      </div>
    </div>
  );
}
